`,paraId:2,tocIndex:0},{value:"Partial<T>",paraId:0},{value:"\u5C06\u6784\u9020\u51FD\u6570 T \u7684\u5C5E\u6027\u5168\u53D8\u4E3A\u53EF\u9009\uFF1A",paraId:3,tocIndex:1},{value:`
